      M.AutoInit();
  }
  )

  console.log('validate');
  console.log(store.getState());
  //console.log(currentuserid);

  return (
    <Provider store={store}>
      <Fragment>      

          <RegisterUserModal></RegisterUserModal>
          <AddButon></AddButon>
          <Login></Login> 
        {/*
          <SearchBar></SearchBar>  
