              <EditEventModal></EditEventModal>        
              <ConfirmEventModal></ConfirmEventModal>
              <Events></Events>        
              <AddButon></AddButon>        
          </div>
        */}

      </Fragment>
    </Provider>
  );
}

App.propTypes = {  
  tokeninfo: propTypes.object
}

